    "2013-03-14T19:22:26.842926",nt"name": "vegetation-medium-scale-central-valley-riparian-vegetation-and-land-use-2011-ds723",nt"isopen":
    false,nt"url": null,nt"notes": "Geodatabase (SDE) feature class containing
    map of vegetation along mainstem rivers and major tributaries (including ancillary
    natural and semi-natural vegetation) found within the Department of Water Resources
    Central Valley Flood Protection Program's Systemwide Planning Area (SPA). This map
    includes vegetation outside of the SPA within Great Valley Ecoregion (GVE) of the
    Central Valley from the King's River drainage north to the town of Red Bluff and
    vegetation above the GVE along the mainstem of the Sacramento River to Keswick Dam.
    Data was modified based on Accuracy Assessment feedback from the CA DFG in August
    2011. Data was originally developed from June 2010 through April 2011 from interpretation
    of the National Agicultural Inventory Program's 2009 (NAIP 2009) aerial imagery
    and hand-digitized at a minimum mapping unit (mmu) of 1.0-acres with a minimum average
    width of 10-meters per polygon. Medium-scale vegetation categories were based on
    the National Vegetation Classification System (NVCS) "group-level" as interpreted
    in Appendix 3 (pp. 1227-1240) of the Manual of California Vegetation, 2nd Ed. (Sawer
    et.al. 2009). "Medium-scale" thus refers to the mid-level thematic resolution
    for vegetation used for the map. This medium-scale mapping effort incorporated provisional
    group categories where no clear relationship between vegetation types and NVCS groups
    existed.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
